import React from 'react';

class Orders extends React.Component {
  state = {
    data: [
      {
        "orderStatus": "Pending", 
        "orderCode": "ABC123",
        "orderName": "Pepito Perez",
        "orderApp": "Rappi"
      },
      {
        "orderStatus": "Pending", 
        "orderCode": "CBA654",
        "orderName": "Sharon Soto",
        "orderApp": "Pedidos Ya"
      },
      {
        "orderStatus": "Pending", 
        "orderCode": "RFV321",
        "orderName": "Juan Rivas",
        "orderApp": "Uber Eats"
      }   
    ]
  }

  render() {
    return (
      <div>
        <h1>Current orders</h1>
        <div className="container">
          <a href="/Orders/new" className="btn btn-primary">
            Add new order
          </a>
        </div>

        <div>
          <ul className="list-unstyled">
            {this.state.data.map((order) => {
            return (
              <li key={order.orderId}>
                <p>{order.orderName}</p>
              </li>
            )
          })}
          </ul>
        </div>
      </div>
    )
  }
}

export default Orders;
